import React, {Fragment} from 'react';   
//import style from './todo.module.css';       

 const NewTodo = () => {
   
    return (
        <Fragment>
                 <form>
                     <div>
                            <label htmlfor='amq'>New AMQ:</label>
                            <input type='text' id='amq' name='name'/>
                     </div>
                 </form>
        </Fragment>
    );
};
export default NewTodo;
